  console.log(children.length);
  return (
    <div className="sidebarleft-mainchat-channel" ref={ref}>
      <span><img src={numbersign} alt="channel" height={18} width={18} /><h3>{heading}</h3>{children}</span>
      {/* <h3>{heading}</h3>
